function Items() {
    return (
        <div className="Items">{id.map(id => (
            <div className="card">
                <img src={lgc} className="card-img-top" alt="..." />

                <div className="card-body">
                    <p className="card-text"> {id}Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                </div>
            </div>))}
        </div>
    );
}

export default Items;
